import React from "react";

import './ListTODO.css'

const ListTODO = props =>{
    return(
        <div className="list">
            <h2 className="list__title">Farm's TODO:</h2>
            <h2 className="list__subtitle">No any Farm's TODO</h2>
            
        </div>
    );
}

export default ListTODO
